DROP TABLE IF EXISTS `project_contract`;
CREATE TABLE `project_contract` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '合同id',
  `num` varchar(30) DEFAULT NULL COMMENT '合同编号',
  `custid` int(11) NOT NULL COMMENT '客户号id',
  `custname` varchar(50) NOT NULL COMMENT '客户名称',
  `contract_name` varchar(255) DEFAULT NULL COMMENT '合同名称',
  `is_frame` tinyint(1) DEFAULT NULL COMMENT '是否框架协议',
  `business_type` tinyint(1) DEFAULT NULL COMMENT '业务类型',
  `engineering_type` tinyint(1) DEFAULT NULL COMMENT '工程类型',
  `service_type` varchar(50) DEFAULT NULL COMMENT '服务类型',
  `contract_amount` decimal(18,4) DEFAULT NULL COMMENT '合同金额',
  `settlement_price` decimal(18,4) DEFAULT NULL COMMENT '结算价',
  `contract_adjustment` decimal(18,4) DEFAULT NULL COMMENT '合同调整额',
  `party` varchar(50) DEFAULT NULL COMMENT '甲方经办人',
  `commission_number` varchar(30) DEFAULT NULL COMMENT '委托号',
  `contract_starttime` datetime DEFAULT NULL COMMENT '合同工期从',
  `contract_endtime` datetime DEFAULT NULL COMMENT '合同工期至',
  `signedtime` datetime DEFAULT NULL COMMENT '签订日期',
  `is_record` tinyint(1) DEFAULT NULL COMMENT '是否备案',
  `is_approve` tinyint(1) DEFAULT NULL COMMENT '是否审批',
  `is_settlement` tinyint(1) DEFAULT NULL COMMENT '是否结算',
  `settlement_time` date DEFAULT NULL COMMENT '结算日期',
  `construction_area` varchar(30) DEFAULT NULL COMMENT '建筑面积',
  `actual_area` varchar(30) DEFAULT NULL COMMENT '实际面积',
  `municipal_amount` decimal(18,4) DEFAULT NULL COMMENT '市政金额',
  `installed_amount` decimal(18,4) DEFAULT NULL COMMENT '安装金额',
  `decoration_amount` decimal(18,4) DEFAULT NULL COMMENT '装饰装修金额',
  `total_investment` decimal(18,4) DEFAULT NULL COMMENT '总投资',
  `actual_investment` decimal(18,4) DEFAULT NULL COMMENT '实际投资',
  `build_amount` decimal(18,4) DEFAULT NULL COMMENT '土建金额',
  `garden_amount` decimal(18,4) DEFAULT NULL COMMENT '园林金额',
  `payment_terms` text COMMENT '付款条款',
  `contract_scope` text COMMENT '合约范围',
  `contract_elements` text COMMENT '合同要素',
  `contract_num` int(5) DEFAULT NULL COMMENT '合同份数',
  `contract_status` tinyint(1) DEFAULT NULL COMMENT '合同状态',
  `file_box` varchar(100) DEFAULT NULL COMMENT '档案盒',
  `results_time` datetime DEFAULT NULL COMMENT '成果文件日期',
  `cumulative_collection` decimal(18,4) DEFAULT NULL COMMENT '累计收款',
  `remarks` text COMMENT '备注',
  `update_time` datetime DEFAULT NULL COMMENT '修改时间',
  `update_id` varchar(20) DEFAULT NULL COMMENT '修改用户id',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `servicecust` varchar(50) DEFAULT NULL COMMENT '服务类型的ID',
  `uid` smallint(6) DEFAULT '0' COMMENT '创建用户id',
  `create_name` varchar(20) DEFAULT NULL,
  `update_name` varchar(20) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=628 DEFAULT CHARSET=utf8 COMMENT='项目合同';

